<style>
.leaflet-control-layers-expanded .leaflet-control-layers-list label { display:flex; align-items:center; justify-content:space-between; }
.leaflet-control-layers-list .switch { position: relative; display:inline-block; width:40px; height:22px; }
.leaflet-control-layers-list .switch input { display:none; }
.leaflet-control-layers-list .slider { position:absolute; cursor:pointer; top:0; left:0; right:0; bottom:0; background-color:#333; border-radius:22px; }
.leaflet-control-layers-list .slider:before { position:absolute; content:''; height:18px; width:18px; left:2px; top:2px; background:white; border-radius:50%; transition:0.2s; }
.leaflet-control-layers-list input:checked + .slider { background:#4CAF50; }
.leaflet-control-layers-list input:checked + .slider:before { transform: translateX(18px); }
</style>
    
<script>
function enhanceLayerControls(){ 
  const container = document.querySelector('.leaflet-control-layers');
  if(!container) return;
  const labels = container.querySelectorAll('label');
  labels.forEach(label=>{
    const input = label.querySelector('input');
    if(!input) return;
    // avoid duplicate processing
    if(label.querySelector('.switch')) return;
    const span = document.createElement('span');
    span.className = 'switch';
    const slider = document.createElement('span');
    slider.className = 'slider';
    // move original checkbox into switch but keep it hidden
    input.style.display='none';
    const wrapper = document.createElement('label');
    wrapper.style.display='inline-block';
    wrapper.appendChild(input.cloneNode(true));
    const newInput = wrapper.querySelector('input');
    newInput.type='checkbox';
    newInput.checked = input.checked;
    // when toggled, trigger click on original input to change layer
    newInput.addEventListener('change', function(){ input.click(); });
    span.appendChild(newInput);
    span.appendChild(slider);
    label.appendChild(span);
  });
}
// run after map loads
setTimeout(enhanceLayerControls, 500);
</script>
